import React from 'react';

const Brand = () => {
    return <div>
        <section style={{ marginBottom: "40px" }}>
            <div className="Brand">
                <center style={{ textAlign: "center" }}>
                    <h2>We are in News</h2>
                    <div style={{ border: "none", paddingBottom: "0px", paddingTop: "30px" }}>
                        <div style={{ padding: "10px", width: "16.66666667%", float: "left" }}><img style={{
                            display: "block",
                            maxWidth: "100%",
                            height: "auto", verticalAlign:"middle", border:"0"
                        }} src={"https://lawrato.com/assets/images/ndtv-logo.jpg"} alt="" /></div>
                        <div style={{ padding: "10px", width: "16.66666667%", float: "left" }}><img style={{
                            display: "block",
                            maxWidth: "100%",
                            height: "auto", verticalAlign:"middle", border:"0"
                        }} src={"	https://lawrato.com/assets/images/indian.jpg"} alt="" /></div>
                        <div style={{ padding: "10px", width: "16.66666667%", float: "left" }}><img style={{
                            display: "block",
                            maxWidth: "100%",
                            height: "auto", verticalAlign:"middle", border:"0"
                        }} src={"	https://lawrato.com/assets/images/hindu.jpg"} alt="" /></div>
                        <div style={{ padding: "10px", width: "16.66666667%", float: "left" }}><img style={{
                            display: "block",
                            maxWidth: "100%",
                            height: "auto", verticalAlign:"middle", border:"0"
                        }} src={"https://lawrato.com/assets/images/ndtv-logo.jpg"} alt="" /></div>
                        <div style={{ padding: "10px", width: "16.66666667%", float: "left" }}><img style={{
                            display: "block",
                            maxWidth: "100%",
                            height: "auto", verticalAlign:"middle", border:"0"
                        }} src={"https://lawrato.com/assets/images/ndtv-logo.jpg"} alt="" /></div>
                        <div style={{ padding: "10px", width: "16.66666667%", float: "left" }}><img style={{
                            display: "block",
                            maxWidth: "100%",
                            height: "auto", verticalAlign:"middle", border:"0"
                        }} src={"https://lawrato.com/assets/images/ndtv-logo.jpg"} alt="" /></div>
                    </div>
                    <a style={{marginTop:"30px", fontWeight: "700", textDecoration: "none", backgroundColor: "#2196f3", color: "white", border: '1px solid #2196f3', borderRadius: "2px", padding: "10px 20px", lineHeight: "5.42857143" }} href="https://lawrato.com/press-media" >See All Media Coverage</a>
                </center>
            </div>
        </section>
    </div>;
};

export default Brand;
